import './App.css';
import Card from './components/Card/Card';
import NavBar from './components/NavBar/NavBar';
import Footer from "./components/Footer/Footer"
function App() {

  return (
    <div> 
      <NavBar/>
      <Card titulo={"Primer Card"} imagen={"https://picsum.photos/200/300"} parrafo={"parrafo Card"} boton={" btn btn-danger"} botonText={"enviar"} />
      <Footer/>
    </div>

  );
}

export default App;
